INSERT INTO `product` (`id`, `name`, `product_id`, `type_1`, `file`, `color`, `category`, `sub_category`, `size`, `description`, `specification`, `price`, `dealer_price`, `clearance`, `clearance_status`, `timelog`, `status`) VALUES
(1, 'Riding boot Romy Junior', '1', 'Customer', '7172zw_41.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '32', 'Adjust this riding boot to your style! The top features a Hook-and-loop fastener so designs can be attached to the riding boot. Riding boot Romy comes with a glitter design. Other designs are available separately. The riding boot features a zipper with elastic insert in the back and an elastic lace in the front.', '', '110', '0', '0', 'saleend', '2023-09-18 05:14:22', '1'),
(2, 'Riding boot Romy Junior wide', '2', 'Customer', '7173zw_12.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Adjust this riding boot to your style! The top features a Hook-and-loop fastener so designs can be attached to the riding boot. Riding boot Romy comes with a glitter design. Other designs are available separately. The riding boot features a zipper with elastic insert in the back and an elastic lace in the front.', '', '110', '0', '', '', '2023-08-29 07:10:48', '1'),
(3, 'Riding boot Julia Junior', '3', 'Customer', '7071zw_22.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'This riding boot has a special size range for children and has features similar to a riding boot for adults. The entire zipper is equipped with barely visible elastic, this way the boot can still fit when the child gets older.', '', '95', '0', '', '', '2023-08-29 07:15:03', '1'),
(4, 'Riding boot Julia Junior wide', '4', 'Customer', '7072zw_12.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'This riding boot has a special size range for children and has features similar to a riding boot for adults. The entire zipper is equipped with barely visible elastic, in this way the boot can still fit when the child gets older.', '', '95', '0', '', '', '2023-08-29 07:17:22', '1'),
(5, 'Riding boot Birgit Adult', '5', 'Customer', '7101zw_21.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'This riding boot has a sporty look due to the tough texture of the material on the shaft and the lace of the zipper. The outside of the calf is made of elastic synthetic leather, the inside of the calf and the foot are made of leather.', '', '125', '0', '', '', '2023-08-29 07:24:46', '1'),
(6, 'Riding boot Birgit Adult wide', '6', 'Customer', '7102zw_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '36', 'This riding boot has a cool look due to the tough texture of the material on the shaft and the lace of the zipper. The outside of the calf is made of elastic synthetic leather, the inside of the calf and the foot are made of leather.', '', '125', '0', '', '', '2023-08-29 07:29:15', '1'),
(7, 'Riding boot Sasha Adult', '7', 'Customer', '7198zw_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '32', 'Adjust this riding boot to your style! The top features a Hook-and-loop fastener so decorative designs can be attached to the riding boot. The boot comes with a glitter design. Other designs are available separately. The riding boot features a zipper with elastic insert in the back and an elastic lace in the front.\r\nPlease note: the chic sole of this boot makes the foot narrower than other QHP riding boots. Are you normally in between sizes? Then choose the larger size for this boot.', '', '159', '0', '', '', '2023-08-29 07:58:10', '1'),
(8, 'Riding boot Sasha Adult wide', '8', 'Customer', '7213zw-2_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Adjust this riding boot to your style! The top features a Hook-and-loop fastener so decorative designs can be attached to the riding boot. The boot comes with a glitter design. Other designs are available separately. The riding boot features a zipper with elastic insert in the back and an elastic lace in the front.', '', '159', '0', '', '', '2023-08-29 08:00:56', '1'),
(9, 'Riding boot Hailey Junior', '9', 'Customer', '7250zw_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Riding boot Hailey is a real eye-catcher in the ring. The top of the boot is decorated with patent leather and glitter. The decorative lacing provides a striking look, but the zip makes it easy to put on. The elasticated lace, elastic insert and comfortable insole ensure high wearing comfort.', '', '135', '0', '', '', '2023-08-30 13:41:54', '1'),
(10, 'Riding boot Hailey Adult', '10', 'Customer', '7250zw_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Riding boot Hailey is a real eye-catcher in the ring. The top of the boot is decorated with patent leather and glitter. The decorative lacing provides a striking look, but the zip makes it easy to put on. The elasticated lace, elastic insert and comfortable insole ensure high wearing comfort.', '', '179', '0', '', '', '2023-08-29 08:19:57', '1'),
(11, 'Riding boot Hailey Adult wide', '11', 'Customer', '7252zw_14.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '34', 'Riding boot Hailey is a real eye-catcher in the ring. The top of the boot is decorated with patent leather and glitter. The decorative lacing provides a striking look, but the zip makes it easy to put on. The elasticated lace, elastic insert and comfortable insole ensure high wearing comfort.', '', '179', '0', '', '', '2023-08-29 08:26:05', '1'),
(12, 'Riding boot Tamar Adult', '12', 'Customer', '7237zw.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Elegant riding boot from flexible and high quality leather The decorative line on the boot provides an elegant look The slanted location of the zipper provides comfort and durability Thanks to the flexible leather elastic lacing and its elastic insert on the backside its a very comfortable boot to wear', '', '159', '0', '', '', '2023-08-29 08:40:17', '1'),
(13, 'Riding boot Tamar Adult wide', '13', 'Customer', '7243zw.jpg', 'black', 'Riding Boots & Accessories ', 'Long Riding Boots', '30', 'Elegant riding boot from flexible and high quality leather. The decorative line on the boot provides an elegant look. The slanted location of the zipper provides comfort and durability Thanks to the flexible leather elastic lacing and its elastic insert on the backside its a very comfortable boot to wear', '', '159', '0', '', '', '2023-08-29 08:49:00', '1'),
