(156, 'Turnout rug falabella 200gr', '36', 'Customer', '6332na_4.jpg', 'Navy', 'Horse Rugs & Sheets', 'Turnout Rugs', '', 'A fine rug with 200 gram lining that ensures your Falabella stays dry and protected from wind. This rug is waterproof, breathable and made of a strong 600 denier turnout fabric. The rug has a good fit and is equipped with rings at the neck to easily attach a loose neck.', 'Fabric composition outside: 100% polyester\r\nFabric composition inside: 100% polyester\r\nFabric composition filling: 100% polyester\r\nWinter rug made of 600D, 3000/3000 ripstop turnout fabric\r\nThis rug is waterproof and breathable\r\nWith 200 gram filling\r\nFleece at the withers\r\nEquipped with a double link closure on the chest\r\nD-Rings for attaching a loose neck\r\nEquipped with gussets, cross surcingles and elastic leg cords\r\nWith tail cord and tail flap \r\nMachine washable at 30 degrees. Preferably do not use fabric softener and do not tumble dry. Do not dry clean', '55', '0', '', '', '2023-09-27 13:39:42', '1'),
(157, 'Turnout rug falabella 0gr', '37', 'Customer', '6331na_4.jpg', 'Navy', 'Horse Rugs & Sheets', 'Turnout Rugs', '', 'A fine rug with 0 gram lining that ensures your Falabella stays dry and protected from wind. This rain rug is waterproof, breathable and made of a strong 600 denier turnout fabric. The rug has a good fit and is equipped with rings at the neck to easily attach a loose neck.', 'Fabric composition outside: 100% polyester\r\nFabric composition inside: 100% polyester\r\nFabric composition filling: 100% polyester\r\nWinter rug made of 600D, 3000/3000 ripstop turnout fabric\r\nThis rug is waterproof and breathable\r\nFleece at the withers\r\nEquipped with a double link closure on the chest\r\nD-Rings for attaching a loose neck\r\nEquipped with gussets, cross surcingles and elastic leg cords\r\nWith tail cord and tail flap \r\nMachine washable at 30 degrees. Preferably do not use fabric softener and do not tumble dry. Do not dry clean', '59', '0', '', '', '2023-09-27 13:43:23', '1'),
(159, 'Bitless bridle Anatomical', '38', 'Customer', '9089zw_8.jpg', 'Black', 'Bridles & Accessories ', 'Bridles', '', 'Anatomically shaped bitless bridle that avoids the nerves and sensitive points of the horse\'s head as much as possible. This makes the bridle suitable for horses that are sensitive on the head. The special curved shape of the noseband makes sure that it is positioned higher up on the nose, thus avoiding the sensitive lower part. In addition, the noseband does not press against the molars, which prevents irritation of the mouth.', 'Material: leather \r\nMaterial hardware: brass\r\nAnatomically shaped bitless bridle\r\nAvoids as much important facial nerves as possible and distributes pressure evenly\r\nThe specially shaped nose band ensures that the cheekbone and the attachment of the facial nerve are free\r\nThe noseband is higher on the nose, avoiding the more sensitive lower part of the nose\r\nThe noseband avoids the teeth and prevents irritation in the mouth\r\nAnatomical extra wide headpiece that keeps the ear free and distributes pressure evenly\r\nThe crown piece minimizes pressure on the neck band\r\nHeadpiece, noseband and the buckle of the noseband are softly padded\r\nWaved browband decorated with rhinestones\r\nSupplied with matching web reins with clips\r\nClean the leather with a cleaner and then rub it in with leather balm. Preferably do not use leather oil, as this can cause the stitching to come loose ', '85', '0', '', '', '2023-09-27 13:51:19', '1'),
(160, 'Bridle Ontario', '39', 'Customer', '9072zw_6.jpg', 'Black', 'Bridles & Accessories', 'Bridles', '', 'Anatomically shaped bridle with a soft imitation fur lining. The lining prevents irritation and is therefore perfect for horses with a sensitive skin. The white stitching and decorative stitching give a luxurious look to the bridle. With soft padding at the closure of the noseband. ', 'Material: leather\r\nMaterial lining: polyester, leather\r\nMaterial hardware: stainless steel\r\nLuxurious bridle with imitation fur lining under the noseband and crown piece\r\nThe imitation fur lining is removable and machine washable\r\nEquipped with specially shaped noseband\r\nSlightly cut back crown piece\r\nWhite stitching for a luxurious look\r\nCalf leather lined browband in wave shape\r\nDouble adjustable throat strap\r\nSoft padding at the closure of the noseband\r\nSupplied with matching web reins\r\nMatching Ontario products available \r\nClean the leather with a cleaner and then rub it in with leather balm. Preferably do not use leather oil, as this can cause the stitching to come loose', '69', '0', '', '', '2023-09-27 13:58:03', '1'),
(161, 'Bridle Devi', '40', 'Customer', '9071zw_5.jpg', 'Black', 'Bridles & Accessories', 'Bridles', '', 'Anatomically shaped bridle which avoids the nerves and sensitive points of the horse\'s head as much as possible. This makes the bridle suitable for horses that are sensitive to the head. The special curved shape of the noseband ensures that it lies higher up on the nose and avoids the sensitive lower part. In addition, the noseband does not press against the horse\'s teeth, which prevents irritation in the mouth. ', 'Material: leather\r\nMaterial hardware: brass\r\nAnatomically shaped bridle\r\nAvoids as much important facial nerves as possible and distributes pressure evenly\r\nThe specially shaped nose band ensures that the cheekbone and the attachment of the facial nerve are free\r\nThe noseband is higher on the nose, avoiding the more sensitive lower part of the nose\r\nThe noseband avoids the teeth and prevents irritation in the mouth\r\nAnatomical extra wide headpiece that keeps the ear free and distributes pressure evenly\r\nThe crown piece minimizes pressure on the neck band\r\nHeadpiece, noseband and the buckle of the noseband are softly padded\r\nSupplied with matching web reins with buckle closure \r\nClean the leather with a cleaner and then rub it in with leather balm. Preferably do not use leather oil, as this can cause the stitching to come loose \r\n', '95', '0', '', '', '2023-09-27 14:03:40', '1'),
