(179, 'Reflective Lead Rope', '54', 'Customer', '71bhUNektJL._AC_SL1500_.jpg', 'pink', 'Headcollars & Lead Ropes', 'Lead Ropes', '', 'A REFLECTIVE LEAD ROPE IS USED TO LEAD OR GUIDE ANIMALS SUCH AS HORSES. THIS REFLECTIVE LEAD IS HIGH-QUALITY HORSE LEAD MADE UP OF REFLECTIVE MATERIAL. IT HAS A SUB-HEAVY SNAP BOLT AT ONE END AND DURABLE PLASTIC. THE LEAD ROPES MEASURE 2 METERS LONG GIVING YOUR HORSE FREEDOM OF MOVEMENT AND ARE AVAILABLE IN DIFFERENT COLORS. THESE LEAD ROPES ARE ATTACHED TO THE HALTER WITH THE HELP OF A SNAP SO THAT THEY CAN BE REMOVED OR ADDED AS NEEDED. THESE LEADS PLAY AN ESSENTIAL ROLE IN LEADING, TYING, OR HOLDING AN ANIMAL\r\n\r\n', '- ROPE LENGTH 2 METER\r\n- TRIGGER SNAP\r\n- EXTRA STRONG PLASTIC CAP WHICH GIVES EXTRA DURABILITY.', '7.99', '0', '', '', '2023-09-27 17:52:54', '1'),
