(183, 'Soft Lunging Aid Training Aid Cotton', '58', 'Customer', '81pWhJ6+HOL._AC_SL1500_.jpg', 'red/grey', 'Lunging & Training', 'Lunging Aids', '', 'A great and easy-to-use lunging aid that will encourage your horse to work through his back and stretch.\r\n\r\nMade from soft cotton with a ring that holds the rope between the legs. \r\n\r\nSimply lay over the back and bring the rope between the front legs attaching the clips to the bit rings or a Headcollar / Cavesson.\r\n\r\n\r\n\r\nEach size can be slightly adjusted for a better fit if required.\r\n\r\nSizes:\r\n\r\nPony 2.7m - 3.3m\r\n\r\nCob 3.2m - 3.9m\r\n\r\nFull 3.60m - 4.30m\r\n', 'Each size can be slightly adjusted for a better fit if required.\r\n\r\nSizes:\r\n\r\nPony 2.7m - 3.3m\r\n\r\nCob 3.2m - 3.9m\r\n\r\nFull 3.60m - 4.30m', '21.99', '0', '', '', '2023-09-27 18:23:23', '1'),
(184, 'LUNGING TRAINING AID FOR SCHOOLING', '59', 'Customer', 's-l1600.jpg', 'purple', 'Lunging & Training', 'Lunging Aids', '', 'A perfect way to work your horse correctly whilst lunging, stretching muscles, and building the correct top line. It is suitable for all disciplines. High Quality \" FAUX MINK FUR\" which is removable with Velcro Fastening One Size Fits Ponies 12hh to 17hh Hunter To use this Training Aid you need a Body Roller, Body, Lunge Reins, Lunge Bridle and Lunge Whip\r\n\r\n Pessoa Style Based\r\nHeavy Duty Fitting and Snaps\r\nSoft Faux Mink Removable Velcro Fastening\r\nHigh Density Elastic\r\nRaw Hide Joints\r\nOne Size Fits All\r\nNo Body Roller is included with this sale  ', ' Pessoa Style Based\r\nHeavy Duty Fitting and Snaps\r\nSoft Faux Mink Removable Velcro Fastening\r\nHigh Density Elastic\r\nRaw Hide Joints\r\nOne Size Fits All\r\nNo Body Roller is included with this sale  ', '24.99', '0', '', '', '2023-09-27 18:31:49', '1'),
(185, 'Side reins Color', '60', 'Customer', 's-l1600 (4).jpg', 'Black', 'Lunging & Training', 'Training Reins', '', 'During lunging, side reins are used to teach the horse to get in contact with the bit. It can be used for a lower, horizontal, or higher position of the head. The rein features 6 D-rings to quickly change the rein in length, which makes it very easy to use. The elastic insert provides comfort for the horse.\r\n\r\nMaterial: Polypropylene\r\nMaterial hardware: zinc, iron\r\nSide reins with elastic part\r\nEquipped with 6 D-rings to adjust the side rein-in length\r\nWith a bolt snap on each side\r\nLength pony (without snaps): 115 cm\r\nLength horse (without snaps): 135 cm', 'Material: Polypropylene\r\nMaterial hardware: zinc, iron\r\nSide reins with elastic part\r\nEquipped with 6 D-rings to adjust the side rein-in length\r\nWith a bolt snap on each side\r\nLength pony (without snaps): 115 cm\r\nLength horse (without snaps): 135 cm', '19.99', '0', '', '', '2023-09-27 18:43:10', '1'),
(186, 'Lunging girth Rollar ', '61', 'Customer', '3132fu_4.jpg', 'pink', 'Lunging & Training', 'Lunging Rollars', '', 'This lunge girth with soft artificial fur is adjustable on both sides. The lunge roller features several rings to attach a lunge aid.\r\n\r\nMaterial girth: 100% polyester\r\nMaterial hardware: iron \r\nLunge girth with artificial fur lining\r\nFeatures several rings to attach a lunge aid to\r\nTwo rings are placed at the withers\r\nBoth sides feature four rings\r\nThe belly girth features two rings\r\nAdjustable on both sides with roller buckles\r\nMatching Ontario products available ', 'Material girth: 100% polyester\r\nMaterial hardware: iron \r\nLunge girth with artificial fur lining\r\nFeatures several rings to attach a lunge aid to\r\nTwo rings are placed at the withers\r\nBoth sides feature four rings\r\nThe belly girth features two rings\r\nAdjustable on both sides with roller buckles\r\nMatching Ontario products available ', '24.99', '0', '', '', '2023-09-27 18:55:30', '1'),
