(188, 'ANATOMICAL BRIDLE SANTA FE', '63', 'Customer', 'EQUIPRIDE3-20 - Copy.jpg', 'brown', 'Bridles & Accessories ', 'Bridles', '', 'Pro Anatomically shaped bridle which avoids the nerves and sensitive points of the horse\'s head and noseband as much as possible. This makes the bridle suitable for horses that are sensitive to the head. The special curved shape of the noseband ensures that it lies higher up on the nose and avoids the sensitive lower part. In addition, the noseband does not press against the horse\'s teeth, which prevents irritation in the mouth. 100% Top Quality Leather Stainless Steel fittings and buckles Anatomically shaped bridle Avoids as many important facial nerves as possible and distributes pressure evenly The specially shaped nose band ensures that the cheekbone and the attachment of the facial nerves are free The noseband is higher on the nose, avoiding the more sensitive lower part of the nose The noseband avoids the teeth and prevents irritation in the mouth Anatomical extra wide headpiece that keeps the ear free and distributes pressure evenly The crown piece minimizes pressure on the neckband Equipped with cow leather soft padding under the crown piece and the noseband Waved browband decorated with gold coloured rhinestones Contrast stitching gives the bridle a remarkable look Supplied with Anti-Slip rubber grip reins', '\r\n    100% Quality Leather Stainless Steel fittings and buckles Anatomically shaped bridle\r\n    Avoids as many important facial nerves as possible and distributes pressure evenly The specially shaped nose band ensures that the cheekbone and the attachment of the facial nerve are free The noseband is higher on the nose, avoiding the more sensitive lower part of the nose\r\n    The noseband avoids the teeth and prevents irritation in the mouth Anatomical extra wide headpiece keeps the ear free and distributes pressure evenly The crown piece minimizes pressure on the neckband\r\n    Equipped with cow leather soft padding under the crown piece and the noseband Waved browband decorated with naturally coloured rhinestones\r\n    Contrast stitching gives the bridle a remarkable look Supplied with Anti-Slip rubber grip reins\r\n', '69.00', '0', '', '', '2023-09-27 19:17:07', '1'),
(189, 'Working Hunter Bridle with Quick Release Snap Hooks Removable Flash', '64', 'Customer', 'EQUIPRIDE3-60.jpg', 'Black', 'Bridles & Accessories', 'Bridles', '', 'Working Hunter bridle with quick-release snap hooks The Anatomical and elegant bridle from the Working Hunter is made of high-quality leather. The bridle has a throat latch and cheekpieces with snap hooks for easy changing of the bit or taking off the throat latch. Softly padded headpiece and noseband with removable flash.\r\n\r\n\r\n    luxurious bridle of high-quality leather with classic loo anatomic headpiece for great mobility of the ears matte and elegant noseband\r\n    snap hooks for quick and easy changing of the bit\r\n    adjustable and removable throat latch with snap hooks and straight browband\r\n    English-style noseband with Removable flash\r\n    stainless steel buckles\r\n', '\r\n    luxurious bridle of high-quality leather with classic loo anatomic headpiece for great mobility of the ears matte and elegant noseband\r\n    snap hooks for quick and easy changing of the bit\r\n    adjustable and removable throat latch with snap hooks and straight browband\r\n    English-style noseband with Removable flash\r\n    stainless steel buckles\r\n', '49.00', '0', '', '', '2023-09-27 19:26:19', '1'),
(191, 'Leather Jodhpurs boots with Front Lace Side Zip', '65', 'Customer', 'WhatsApp Image 2023-07-13 at 19.57.55.jpeg', 'Black', 'Riding Boots & Accessories ', 'Jodhpurs and Paddock Boots', '', 'Ankle Boots Our ankle boots are made of super soft tanned cowhide leather, which adapts perfectly to the foot. Equipride uses soft leather to offer optimal wearing comfort even when the boots are worn for a long time. The leather is a little more rustic in appearance. The specially developed lasts offer maximum comfort. They are narrowly cut and have a relatively low instep, which ensures that even narrow feet have a secure hold in the ankle boots. The high-quality insole ensures optimal pressure distribution in the sole and is breathable at the same time for a comfortable fit. The robust anti-slip rubber sole of the shoe is very flexible and allows anatomical rolling and is therefore gentle on the joints. The ankle boot has a curved side zipper. This molds itself comfortably to the ankle. There is an elastic lacing at the front. It offers a good scope for more movement and greater groin comfort. - soft tanned cowhide leather (soft leather) - narrow bar - insole highly breathable and soft to roll off - rubber sole offers a secure frame - robust zipper on the side - side elastic zones', 'Additional information Size: 3-9 UK Material: Cow leather Color: black, brown', '55', '0', '', '', '2023-09-27 19:48:31', '1'),
(192, 'Horse toy Timmy', '66', 'Customer', '5190paa (1).jpg', 'white', 'Stable & Pasture', 'Horse Relax Toys ', '', 'The perfect buddy for your horse in the stable! Does your horse sometimes get bored in the stable? With the horse toy, this is a thing of the past. Not only does it look nice, but it also gives your horse an activity in the stable.\r\n\r\nMaterial outside: suede\r\nMaterial filling: filling made of coconut fiber\r\nMaterial cord: cotton, jute\r\nThis horse toy will keep your horse amused in the stable\r\nPrevents boredom\r\nEasy to hang up with the rope\r\nSafe for the horse\r\nDurable and eco-friendly material\r\n\r\nThe filling of the horse toys is naturally degradable and therefore not harmful to your horse', 'Height carrot: 31 cm\r\nHeight unicorn: 30 cm\r\nHeight horse: 40 cm \r\n\r\nThe filling of the horse toys is naturally degradable and therefore not harmful to your horse', '18.50', '0', '', '', '2023-09-27 19:58:35', '1'),
