(195, 'Horse toy ball', '69', 'Customer', '5447rz_2 (1).jpg', 'pink', 'Stable & Pasture', 'Horse Relax Toys ', '', 'Nice horse toy to hang in the stable or paddock. You can easily attach carrots using the elastic loops. This ensures even more fun for your horse and prevents stress and boredom.\r\n\r\nMaterial outside: suede\r\nMaterial filling: coconut fiber\r\nMaterial cord: cotton, jute \r\nThis horse toy will keep your horse amused in the stable\r\nPrevents boredom\r\nEasy to hang up with the rope\r\nSafe for the horse\r\nDurable and eco-friendly material\r\n\r\nThe filling of the horse toys is naturally degradable and therefore not harmful to your horse', 'The filling of the horse toys is naturally degradable and therefore not harmful to your horse', '19.99', '0', '', '', '2023-09-27 20:09:56', '1'),
(196, 'Horse Fun Play Ball', '70', 'Customer', '61U35vhYwOL.jpg', 'Red', 'Stable & Pasture', 'Horse Relax Toys ', '', 'Horse Fun Play Ball The Fun Play Ball is made of high-quality materials and is therefore extremely strong. The inner layer of the ball consists of rubber, which is covered with strong cotton. Because the outside is made of PU material, the ball is soft, durable, and practically indestructible. The ball can be easily hung up in the stable or meadow via the top loop. The attached elastic bands on the Maximus Fun Play Ball offer the possibility of attaching hay, grass, or other snacks to the ball. The loop and the rubber bands make it extra easy for your horse or pony to pick up the Fun Play Ball. This guarantees a lot of fun and challenge. The ball comes with a pump. The solution for boredom in the stable or in the field! Size 19 cm Item Specifications Weight 0,48 kg Height 20 cm Length 20 cm Width 12 cm', 'Size 19 cm Item Specifications Weight 0,48 kg Height 20 cm Length 20 cm Width 12 cm', '18.99', '0', '', '', '2023-09-27 20:15:47', '1');
