(198, 'Country Boot Gordon ', '72', 'Customer', 'Equipride101.jpg', 'brown', 'Riding Boots & Accessories ', 'Country Boots', '', 'Dog walking, horse riding, or Fishing / Hunting These waterproof country boots are suitable for all. It comes with amazing bovine nubuck leather, with a side zipper and gusset, making it easier to wear. Not to forget about the breathable waterproof membrane lining (up to 16 cm ) from the bottom, which keeps your feet dry in all weather. The insocks are super comfy, which pampers your feet throughout the use. This boot is a must for the wardrobe of every rider/dog owner/fisher/hunter\r\n\r\nMaterial: Cow leather \r\nSole: Euro Rider\r\nZip: YKK\r\n\r\n100% Waterproof \r\n\r\n\r\n\r\n', 'Calf Size measurement\r\n\r\n3 UK height 39.5 cm Width 36.5 cm\r\n4 UK height 40.5 cm Width 37.5 cm\r\n5 UK height 40.5 cm Width 38.5 cm\r\n6 UK height 41 cm Width 39.5 cm\r\n6.5 UK height 41 cm Width 39.5 cm\r\n7 UK height 42 cm Width 40.5 cm\r\n8 UK height 42.5 cm Width 41 cm', '89.00', '0', '', '', '2023-09-27 20:34:38', '1'),
(199, 'Children Half Chap Suede', '73', 'Customer', '7107zw_6.jpg', 'Black', 'Riding Boots & Accessories ', 'Half Chaps', '', 'The right chap for the beginning rider is made of artificial suede. With large elastic on the rear for a snug fit and is available in pretty colours. \r\n\r\n Want to know which size is best? Then check out the size chart.\r\n\r\nMaterial: 60% nylon, 40% polyester\r\nBasic model chap made of artificial suede\r\nA model with low dressage bow\r\nThe nonslip material provides a good grip against the horse and the saddle\r\nOn the side equipped with a zipper with on top a Hook-and-loop fastener and below a zipper protector with press studs with pretty colours\r\nLarge elastic insert along the zipper. This will ensure a proper fit\r\nLined with smooth fabric\r\nWith elastic below the foot, reinforced with a piece of fabric', 'studs with pretty colours\r\nLarge elastic insert along the zipper. This will ensure a proper fit\r\nLined with smooth fabric\r\nWith elastic below the foot, reinforced with a piece of fabric', '19.99', '0', '', '', '2023-09-27 21:03:35', '1'),
(200, 'Thermo jodhpurs Calgary adult', '74', 'Customer', '7267ZW_40.jpg', 'Black', 'Riding Boots & Accessories ', 'Jodhpurs and Paddock Boots', '', 'Jodhpur Calgary has a cool look because of the stitching and the zipper on the front. This jodhpur is very comfortable because of its soft and warm lining. This makes the jodhpur perfect for cold days.\r\n\r\nMaterial: leather\r\nMaterial inner lining: polyester \r\nMaterial sole: rubber \r\nJodhpur with zipper and elastic insert at the back\r\nMade of sturdy leather with extra reinforcement on the nose and at the heel\r\nLined with imitation fur\r\nWith 2 elastic inserts on the back for extra comfort\r\nThe leather loop on the back makes it easy to put on the boot.\r\nEquipped with decorative stitching\r\nFoot lined with breathable fabric\r\nThe sole is made of layered material for optimal comfort\r\nRubber sole raised on both sides of the instep for extra sturdiness', 'Material: leather\r\nMaterial inner lining: polyester \r\nMaterial sole: rubber \r\nJodhpur with zipper and elastic insert at the back\r\nMade of sturdy leather with extra reinforcement on the nose and at the heel\r\nLined with imitation fur\r\nWith 2 elastic inserts on the back for extra comfort\r\nThe leather loop on the back makes it easy to put on the boot.\r\nEquipped with decorative stitching\r\nFoot lined with breathable fabric\r\nThe sole is made of layered material for optimal comfort\r\nRubber sole raised on both sides of the instep for extra sturdiness', '59.00', '0', '', '', '2023-09-27 21:12:18', '1'),
