(207, 'Telescopic Lunging Whip With Golf Grip', '80', 'Customer', '1413801-2_03.png', 'Black', 'Whips & Spurs', 'Lunging Whips', '', 'High-quality and extremely light telescopic whip with a nylon lash. Its carbon and fiberglass mix core, and resulting low weight, make this telescopic whip impressive. Tired arms belong to the past. The non-slip long golfing grip sits extremely well in the hand.\r\n\r\nLength: 200 cm\r\nLash length: 250 cm\r\nWeight: approx. 150 g', 'ATTENTION: from 100 cm in length the shipment will be made as bulky goods', '39.99', '0', '', '', '2023-10-01 11:00:11', '1'),
(208, 'Stable rug Classy', '81', 'Customer', '6294na_24.jpg', 'Navy', 'Horse Rugs & Sheets', 'Stable and Under Rugs', '', 'Luxury stable rug from the Classy line with a thick collar of faux fur and decorative cord. The soft inside of faux fur gives the rug a warm and pleasant feeling. The rug is equipped with a 100-gram lining.\r\n \r\nWant to know which size is most suitable for your horse?\r\nCheck out the size chart.\r\n\r\nFabric composition outside: 100% polyester\r\nFabric composition inside 100% polyester\r\nFabric composition filling: 100% polyester (100 gsm)\r\nStable rug from the Classy line\r\nStitching in pattern\r\nWith decorative cord\r\nWith a thick imitation wool collar\r\nInside fitted with imitation wool\r\nThe rug has detachable cross surcingles and a tail cord\r\nEquipped with leg straps', 'Fabric composition outside: 100% polyester\r\nFabric composition inside 100% polyester\r\nFabric composition filling: 100% polyester (100 gsm)\r\nStable rug from the Classy line\r\nStitching in pattern\r\nWith decorative cord\r\nWith a thick imitation wool collar\r\nInside fitted with imitation wool\r\nThe rug has detachable cross surcingles and a tail cord\r\nEquipped with leg straps', '110.00', '0', '', '', '2023-10-01 11:16:10', '1'),
(209, 'Fleece rug Brilliance', '82', 'Customer', '6155pre (1).jpg', 'porto red', 'Horse Rugs & Sheets', 'Fleece and Wool Rug', '', 'Let your horse shine with this very elegant show rug with the collar of satin and imitation wool. The fleece rug is made of extra soft fleece for extra comfort. The two-tone decorative cord completes the look.\r\n\r\nThe horse in the pictures is wearing size 195. See the size chart for more information.\r\n\r\nFabric composition: 100 % polyester\r\nElegant 250GSM fleece rug\r\nCollar with imitation wool and satin\r\nEquipped with a double coupling closure on the chest\r\nFitted with black metal hardware\r\nThe rug has removable cross surcingles and a tail cord\r\nMachine washable at 30 degrees. Close the hook-and-loop fastener and wash the rug in a laundry bag. Preferably do not use a fabric softener and do not tumble dry', 'Fabric composition: 100 % polyester\r\nElegant 250GSM fleece rug\r\nCollar with imitation wool and satin\r\nEquipped with a double coupling closure on the chest\r\nFitted with black metal hardware\r\nThe rug has removable cross surcingles and a tail cord\r\nMachine washable at 30 degrees. Close the hook-and-loop fastener and wash the rug in a laundry bag. Preferably do not use a fabric softener and do not tumble dry', '60.00', '0', '', '', '2023-10-01 11:25:59', '1'),
(210, 'ECZEMA RUG ATTACHED NECK', '83', 'Customer', 'WhatsApp Image 2023-03-29 at 17.25.52 (3).jpeg', 'grey', 'Horse Rugs & Sheets', 'Fly and Eczema Rugs', '', 'This eczema rug features an attached neck with elastic closure, a wide belly flap with elastic, adjustable surcingles, and a wide tail flap. The rug has plastic closures and a closure between the front legs to attach the belly flap. Research has proven that a zebra pattern deters flies due to the fact that the stripes reflect light. This reflection irritates insects.\r\n\r\nMaterial: 100% Polyester\r\nEczema rug with fine mesh Breathable fabric\r\nAttached neck with elastic insert Wide belly flap with adjustable, elastic surcingles\r\nWide tail flap Plastic buckles\r\nelastic, adjustable leg straps, and Elastic inserts at the neck, belly flap, and legs', 'Material: 100% Polyester\r\nEczema rug with fine mesh Breathable fabric\r\nAttached neck with elastic insert Wide belly flap with adjustable, elastic surcingles\r\nWide tail flap Plastic buckles\r\nelastic, adjustable leg straps, and Elastic inserts at the neck, belly flap, and legs', '55.00', '0', '', '', '2023-10-01 11:46:16', '1'),
(211, 'Reindeer hat', '84', 'Customer', '5091ro_6.jpg', 'Red', 'Bridles & Accessories', 'Ear Bonnets and  Fly Veils', '', 'Funny hat for horses with white antlers and fur lining. Matches well with our other Christmas products.\r\n\r\nMaterial: polyester\r\nEar net to be used under a bridle\r\nRed finished with imitation fur\r\nEars in the shape of reindeer antlers\r\nFinish your Christmas horse with other Christmas products\r\nMachine washable at 30 degrees. Wash the ear net in a laundry bag and preferably do not use a fabric softener. Do not tumble dry.', 'Material: polyester\r\nEar net to be used under a bridle\r\nRed finished with imitation fur\r\nEars in the shape of reindeer antlers\r\nFinish your Christmas horse with other Christmas products\r\nMachine washable at 30 degrees. Wash the ear net in a laundry bag and preferably do not use a fabric softener. Do not tumble dry.', '12.50', '0', '', '', '2023-10-02 18:35:35', '1'),
