(228, 'TURNOUT RUG STANDARD NECK 300', '97', 'Customer', '6003db_24.jpg', 'Navy', 'Horse Rugs & Sheets', 'Turnout Rugs', '', 'Basic model turnout rug with 300g fill. The basic turnout rug is waterproof, breathable, and available in black and dark blue. The rug features D-rings at the neck to attach a separate neck cover. \r\n \r\nWant to know what size your horse needs? Check out the size chart.\r\n\r\nfabric composition outside 100% polyester\r\nFabric composition inside: 65% polyester, 35% cotton\r\nFabric composition filling: 100% polyester \r\nMaterial hardware: stainless steel\r\nTurnout rug made of 600D 3000/3000 ripstop fabric\r\nRain rug of 600D, 3000/3000 rip-stop turnout fabric\r\n600 D combined with rip-stop stands for abrasion resistance.\r\n3000/3000 stands for waterproofness and breathability.\r\nWaterproof, 3000 mm/m2\r\nThe rug is waterproof and breathable\r\nEquipped with a 300-gram filling\r\nDouble front closure with surcingle clasps\r\nFeatures D-rings to attach a loose neck\r\nFeatures shoulder gussets, cross surcingles, and elastic leg straps\r\nExtra large tail flap \r\nMachine washable at 30 degrees. Do not use a fabric softener and do not tumble dry. Do not dry clean', 'fabric composition outside 100% polyester\r\nFabric composition inside: 65% polyester, 35% cotton\r\nFabric composition filling: 100% polyester \r\nMaterial hardware: stainless steel\r\nTurnout rug made of 600D 3000/3000 ripstop fabric\r\nRain rug of 600D, 3000/3000 rip-stop turnout fabric\r\n600 D combined with rip-stop stands for abrasion resistance.\r\n3000/3000 stands for waterproofness and breathability.\r\nWaterproof, 3000 mm/m2\r\nThe rug is waterproof and breathable\r\nEquipped with a 300-gram filling\r\nDouble front closure with surcingle clasps\r\nFeatures D-rings to attach a loose neck\r\nFeatures shoulder gussets, cross surcingles, and elastic leg straps\r\nExtra large tail flap \r\nMachine washable at 30 degrees. Do not use a fabric softener and do not tumble dry. Do not dry-clean', '44.99', '0', '', '', '2023-10-12 20:30:14', '1'),
(232, 'Shetland saddle', '99', 'Customer', '3100rz_1.jpg', 'pink', 'Saddles Girths & Leathers ', 'Cub and Pony Saddle', '', 'Kids\' saddle is fully equipped with girth, stirrup leathers, and stirrups. Perfect for small riders, who are able to saddle their pony themselves with lightweight Shetland saddle. Handle on the front for grip. Ring on the rear for potential crupper attachment.\r\n\r\nSynthetic kids saddle\r\nLightweight\r\nFully equipped with aluminum stirrups, nylon stirrup leathers, and nylon girth with roller buckles\r\nThe saddle is equipped with panels which are adjustable with a Hook-and-loop fastener\r\nLength saddle: 29 cm, length seat: 21 cm (Please note: this saddle is treeless and therefore has no inch size)\r\nHandle on the front\r\nRing on the rear for crupper attachment', 'Synthetic kids saddle\r\nLightweight\r\nFully equipped with aluminum stirrups, nylon stirrup leathers, and nylon girth with roller buckles\r\nThe saddle is equipped with panels which are adjustable with a Hook-and-loop fastener\r\nLength saddle: 29 cm, length seat: 21 cm (Please note: this saddle is treeless and therefore has no inch size)\r\nHandle on the front\r\nRing on the rear for crupper attachment', '89.00', '0', '', '', '2023-10-12 21:51:46', '1'),
(233, 'Complete saddle set', '100', 'Customer', '3101rz_2.jpg', 'pink', 'Saddles Girths & Leathers ', 'Cub and Pony Saddle', '', 'This saddle set ensures the young rider is ready to go with his or her pony. The lightweight saddle comes with girth, stirrup leathers, and stirrups. Also included is a bridle with noseband and flash.\r\n\r\nMaterial saddle and equipment: artificial leather\r\nMaterial bridle: leather\r\nSaddle set for children fully equipped with bridle and reins\r\n13-inch child saddle\r\n27 cm tree size (10.5 inch)\r\nComes with 100 cm girth, stirrup leathers of 100 cm, and aluminum child stirrups\r\nRing on the rear for attachment of crupper\r\nLeather bridle equipped with noseband and flash\r\nBrowband and noseband\r\nComes with matching reins\r\nThere is a small color difference between the pink saddle and the bridle', 'Material saddle and equipment: artificial leather\r\nMaterial bridle: leather\r\nSaddle set for children fully equipped with bridle and reins\r\n13-inch child saddle\r\n27 cm tree size (10.5 inch)\r\nComes with 100 cm girth, stirrup leathers of 100 cm, and aluminum child stirrups\r\nRing on the rear for attachment of crupper\r\nLeather bridle equipped with noseband and flash\r\nBrowband and noseband\r\nComes with matching reins\r\nThere is a small color difference between the pink saddle and the bridle', '185.00', '0', '', '', '2023-10-12 22:09:32', '1'),
