(239, 'Belly guard girth with luxury stitching', '105', 'Customer', '3022dbr_6.jpg', 'brown', 'Saddles Girths & Leathers ', 'Girths', '', 'Anatomically designed girth with a stud guard made of leather with soft padding. Equipped with a carabiner. Decorated with white stitching for a chic appearance.\r\n\r\nWant to know what size your horse needs? Check out the size chart.\r\n\r\nMaterial: leather\r\nMaterial hardware: stainless steel\r\nStrong girth made of cow leather\r\nAnatomically designed for comfort and freedom of movement\r\nLined with soft leather padding for increased comfort\r\nEquipped with a guard to protect the belly when using studs\r\nOn the belly flap there is a carabiner at the front that is partly covered with leather\r\nD-ring on the front on both sides\r\nMatching colour elastic on both ends for easy fastening and increased comfort\r\nStrong buckles with rollers \r\nClean the leather with a cleaner and then rub it in with leather balm. Preferably do not use leather oil, as this can cause the stitching to come loose', 'Material: leather\r\nMaterial hardware: stainless steel\r\nStrong girth made of cow leather\r\nAnatomically designed for comfort and freedom of movement\r\nLined with soft leather padding for increased comfort\r\nEquipped with a guard to protect the belly when using studs\r\nOn the belly flap there is a carabiner at the front that is partly covered with leather\r\nD-ring on the front on both sides\r\nMatching colour elastic on both ends for easy fastening and increased comfort\r\nStrong buckles with rollers \r\nClean the leather with a cleaner and then rub it in with leather balm. Preferably do not use leather oil, as this can cause the stitching to come loose', '90.00', '0', '', '', '2023-10-12 23:03:16', '1'),
